import { newItem, newItemData } from "../../../../commons/utils/common";
import { itemRemoveStyle } from "../../item/js";
import { useMainStore } from "../../../store";
// pinia
const store = useMainStore();

let cmdIcon =
  "data:image/png;base64,";
let powerShellIcon =
  "data:image/png;base64,";

/**
 * 删除所有选中项目样式
 * @param className
 * @param selected
 */
function itemAllRemoveStyle(className: string, selected: number) {
  let elementList = document.getElementsByClassName(className);
  for (let i = 0; i < elementList.length; i++) {
    const element = elementList[i];
    let index = element.getAttribute("index");
    if (index && selected !== parseInt(index)) {
      itemRemoveStyle(element, className);
    }
  }
}

/**
 * 移动滚动条
 * @param className
 * @param height
 * @param type
 * @param selected
 */
function searchResultDivMoveScroll(
  className: string,
  height: number,
  type: "up" | "down",
  selected: number
) {
  let listEL = document.getElementById("search-result-list");
  let itemEl = document.getElementById(className + "-" + selected);
  if (listEL && itemEl) {
    let itemRect = itemEl.getBoundingClientRect();
    let realY = itemRect.y - height - 1 + 48;
    if (type === "up") {
      if (realY < 48) {
        let sim = listEL.getElementsByClassName("simplebar-content-wrapper")[0];
        sim.scrollTop = sim.scrollTop - (48 - realY);
      }
    } else {
      if (realY > listEL.clientHeight) {
        let sim = listEL.getElementsByClassName("simplebar-content-wrapper")[0];
        sim.scrollTop = sim.scrollTop + (realY - listEL.clientHeight);
      }
    }
  }
}

/**
 * 获取命令行项目
 */
function getCommandLineItemList() {
  let cmdItem = newItem({
    classificationId: 99999,
    name: store.language.commandPrompt,
    data: newItemData({
      icon: cmdIcon,
      target: "cmd",
    }),
  });
  let powerShellItem = newItem({
    classificationId: 99999,
    name: store.language.powerShell,
    data: newItemData({
      icon: powerShellIcon,
      target: "powershell",
    }),
  });
  if (store.setting.commandLine.defaultUse === "cmd") {
    return [cmdItem, powerShellItem];
  } else {
    return [powerShellItem, cmdItem];
  }
}

// 命令行运行
function commandLineRun(target: string, text: string | null) {
  let params = "";
  let val = text ?? "";
  if (target === "cmd") {
    params = '/k "' + val + '"';
  } else {
    params = '-NoExit "' + val + '"';
  }
  window.api.run("open", target, params, null);
}

export {
  itemAllRemoveStyle,
  searchResultDivMoveScroll,
  getCommandLineItemList,
  commandLineRun,
};
